//-----------------------------------------------------------------------------------------------------------------------------------------------------------------
struct AXIS_INPUT{
	float data;
	bool last;
};

struct AXIS_OUTPUT {
    int data;
    bool last;
};

void mlp(hls::stream<AXIS_INPUT>& S_AXIS, hls::stream<AXIS_OUTPUT>& M_AXIS)
{
    #pragma HLS INTERFACE ap_ctrl_none port=return
    #pragma HLS INTERFACE axis port=S_AXIS
    #pragma HLS INTERFACE axis port=M_AXIS
    AXIS_INPUT read_input;
    AXIS_OUTPUT write_output;
    float input_data[INPUT_NODES] = {};
    for (int i = 0; i < INPUT_NODES; i++) {
        read_input = S_AXIS.read();
    	input_data[i] = (float)read_input.data;
    }
    float outputFromInputLayer[INPUT_LAYER_NODES] = {};
    float outputFromHiddenLayer1[HIDDEN_LAYER_1_NODES] = {};
    float outputFromHiddenLayer2[HIDDEN_LAYER_2_NODES] = {};
    float outputFromHiddenLayer3[HIDDEN_LAYER_1_NODES] = {};
    float outputFromHiddenLayer4[HIDDEN_LAYER_2_NODES] = {};
    float outputFromOutputLayer[OUTPUT_LAYER_NODES] = {};
    // input layer
    int idx = 0;
    for (int i = 0; i < INPUT_LAYER_NODES; i++)
    {
        input_layer_for1_1:for (int j = 0; j < INPUT_NODES; j++)
        {
            outputFromInputLayer[i] += input_data[j] * (float)input_layer_weight[idx];
            idx += 1;
        }
    }
    input_layer_for2:for (int i = 0; i < INPUT_LAYER_NODES; i++)
    {
        outputFromInputLayer[i] += (float)input_layer_bias[i];
        outputFromInputLayer[i] = (outputFromInputLayer[i] < 0) ? (float)(outputFromInputLayer[i] * 0.01) : outputFromInputLayer[i];
    }
    // first hidden layer
    idx = 0;
    for (int i = 0; i < HIDDEN_LAYER_1_NODES; i++)
    {
        h1_layer_for1_1:for (int j = 0; j < INPUT_LAYER_NODES; j++)
        {
            outputFromHiddenLayer1[i] += outputFromInputLayer[j] * (float)h1_weight[idx];
            idx += 1;
        }
    }
    h1_layer_for2:for(int i = 0; i < HIDDEN_LAYER_1_NODES; i++)
    {
        outputFromHiddenLayer1[i] += (float)h1_bias[i];
        outputFromHiddenLayer1[i] = (outputFromHiddenLayer1[i] < 0) ? (float)(outputFromHiddenLayer1[i] * 0.05) : outputFromHiddenLayer1[i];
    }
    // second hidden layer
    idx = 0;
    for (int i = 0; i < HIDDEN_LAYER_2_NODES; i++)
    {
        h2_layer_for1_1:for (int j = 0; j < HIDDEN_LAYER_1_NODES; j++)
        {
            outputFromHiddenLayer2[i] += outputFromHiddenLayer1[j] * (float)h2_weight[idx++];
        }
    }
    h2_layer_for2:for (int i = 0; i < HIDDEN_LAYER_2_NODES; i++)
    {
        outputFromHiddenLayer2[i] += (float)h2_bias[i];
        outputFromHiddenLayer2[i] = (outputFromHiddenLayer2[i] < 0) ? (float)(outputFromHiddenLayer2[i] * 0.05) : outputFromHiddenLayer2[i];
    }
    // third hidden layer
    idx = 0;
    for (int i = 0; i < HIDDEN_LAYER_3_NODES; i++)
    {
        h3_layer_for1_1:for (int j = 0; j < HIDDEN_LAYER_2_NODES; j++)
        {
            outputFromHiddenLayer3[i] += outputFromHiddenLayer2[j] * (float)h3_weight[idx++];
        }
    }
    h3_layer_for2:for (int i = 0; i < HIDDEN_LAYER_3_NODES; i++)
    {
        outputFromHiddenLayer3[i] += (float)h3_bias[i];
        outputFromHiddenLayer3[i] = (outputFromHiddenLayer3[i] < 0) ? (float)(outputFromHiddenLayer3[i] * 0.05) : outputFromHiddenLayer3[i];
    }
    //fourth hidden layer
    idx = 0;
    for (int i = 0; i < HIDDEN_LAYER_4_NODES; i++)
    {
        h4_layer_for1_1:for (int j = 0; j < HIDDEN_LAYER_3_NODES; j++)
        {
            outputFromHiddenLayer4[i] += outputFromHiddenLayer3[j] * (float)h4_weight[idx++];
        }
    }
    h4_layer_for2:for (int i = 0; i < HIDDEN_LAYER_4_NODES; i++)
    {
        outputFromHiddenLayer4[i] += (float)h4_bias[i];
        outputFromHiddenLayer4[i] = (outputFromHiddenLayer4[i] < 0) ? (float)0 : outputFromHiddenLayer4[i];
    }
    // output layer
    idx = 0;
    for (int i = 0; i < OUTPUT_LAYER_NODES; i++)
    {
        output_layer_for1_1:for (int j = 0; j < HIDDEN_LAYER_4_NODES; j++)
        {
            outputFromOutputLayer[i] += outputFromHiddenLayer4[j] * (float)output_layer_weight[idx++];
        }
    }
    output_layer_for2:for (int i = 0; i < OUTPUT_LAYER_NODES; i++)
    {
        outputFromOutputLayer[i] += (float)output_layer_bias[i];
    }
    float sum = 0;
    //min-max normalization first before doing softmax
    float max_val = -10000;
    float min_val = 10000;
    output_layer_for3:for (int i = 0; i < OUTPUT_LAYER_NODES; i++) {
        if (outputFromOutputLayer[i] > max_val) {
            max_val = outputFromOutputLayer[i];
        } else if (outputFromOutputLayer[i] < min_val) {
            min_val = outputFromOutputLayer[i];
        }
    }
    output_layer_for4:for (int i = 0; i < OUTPUT_LAYER_NODES; i++) {
        outputFromOutputLayer[i] = (outputFromOutputLayer[i] - min_val) / (max_val - min_val);
    }
    //softmax implementation, exponential indices in [0,1]
    output_layer_for5:for (int i = 0; i < OUTPUT_LAYER_NODES; i++)
    {
        sum += (float)exp((float)outputFromOutputLayer[i]);
    }
    output_layer_for6:for (int i = 0; i < OUTPUT_LAYER_NODES; i++)
    {
        outputFromOutputLayer[i] = (float)exp((float)outputFromOutputLayer[i]) / sum;
    }

    int action = -1;
    float max = 0;
    final_output_unroll_for:for (int i = 0; i < OUTPUT_LAYER_NODES; i++)
    {
        if (outputFromOutputLayer[i] > max)
        {
            max = outputFromOutputLayer[i];
            action = i;
        }
    }
    write_output.data = action;
    write_output.last = 1;
    M_AXIS.write(write_output);
}
